//This tool just provides partial support for creating/extracting splash.img
/* 
  STEPS to create splash.img:
  ----------------------------
   1. Converting PNG/JPG picture to raw rg24 format (I use FFMPEG Open Source tool for this)
     (This step is done by CREATE_Logo.bat)
   2. Converting the raw file to RGB24-RLE Encoded splash.img
     (This is the actual step done by this tool)
 
  It's just the reverse for extracting splash.img ..
*/

// Check here for CM-SPLASH v1 Tool: http://forum.xda-developers.com/yu-yuphoria/general/custom-splash-screens-boot-logo-yuphoria-t3402521/post67407050#post67407050
// Inspired from RLimager1.2.c from here: http://forum.xda-developers.com/showthread.php?t=2764354

// CM-SPLASH v1 Tested to be working on devices: Yu Yuphoria, Yu Yunique, Yu Yutopia, & Zuk Z1..
// CM-SPLASH v2 Tested to be working on Wileyfox Swift & Wileyfox Storm..

// May work on other devices too that use CM-SPLASH if used properly ;)
// (Just open splash.img using a Hex Editor in PC & look at first 2 lines to check if it's "CM-SPLASH!! vX" )

/*
	CM-SPLASH v1 splash.img Format:
	--------------------------------
	1. Splash Header (First 512 Bytes by default)
	2. Payload Data
	
	1. Splash Header Format:
		-------------------------------------------------------------
		Byte Range (Hex)	Description
		-------------------------------------------------------------
		00 - 0F				"CM-SPLASH!!"
		10 - 1F				"v1"
		20 - 23				Width of picture1 (Little Endian)
		24 - 27				Height of picture1 (Little Endian)
		28 - 2F				Zeros
		30 - 33				Length of Payload Data (Byte Count of picture1) (Little Endian)
		34 - 3B				Zeros
		3C - 3F				Offset of picture1 (Little Endian)
	
		Similarly repeat last 32 bytes for picture2 in 40 to 5F and so on....
	(Thanks to @makers_mark who pointed this out here: http://forum.xda-developers.com/nexus-9/themes-apps/tool-splash-screen-flasher-v1-0-t2931575/post67365057 )
	
	2. Payload Data:
		Each Consecuive 4 Bytes of Data denotes a contiguous color range in R,G,B,count (max value of count = 255 (0xFF)).
		See comments in decode() & encode() functions for more info.
		
*/

/*
	CM-SPLASH v2 splash.img Format:
	--------------------------------
	In addition to above, the last 32 bytes of header is for fastboot UI Offset, Count, etc.
	Fastboot UI payload is present finally after the payload of all pictures.
	No complete support for it, since I'm unable to figure out what format it is..
*/

